	  },
	  {
		Title: "Star Wars: Episode VI - Return of the Jedi",
		Year: "1983",
		imdbID: "tt0086190",
		Type: "movie",
		Poster:
		  "https://m.media-amazon.com/images/M/MV5BOWZlMjFiYzgtMTUzNC00Y2IzLTk1NTMtZmNhMTczNTk0ODk1XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg",
	  }
  ]);

  return (
    <div className="container-fluid movie-app">
      <div className="row" style={{marginTop: '3rem', display: 'flex', flexDirection: 'row', justifyContent: 'space-evenly', alignItems: 'center', flexWrap: 'nowrap'}}><MovieList movies={movies} /></div>
    </div>
  );
};

export default App;
